import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render(){
    /*return(
      <div className="App">
        <h1>Hola</h1>
      </div>
    )*/
      var h1 = React.createElement('h1', null, 'Hola soy React!!')
      return React.createElement('div', {class: 'App'}, h1);

  }
}

export default App;
